INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3102870040463', 'Ail semoule', 'Depuis 1876, nos experts parcourent le globe pour vous faire découvrir les meilleures épices. Spigol, héritier de ce savoir-faire, vous fait padager ces trésors aromatiques au travers d\'une gamme riche et authentique. Retrouvez tous nos produits et idées recettes sur xyww,spigowcom AIL Semoule Contient des sulfites. Traces de graines de sésame, moutarde, céleri, gluten. NOTRE su«vsrroV DE RECETTE : Duo de mousse dejambon tomate au pesto : Pour la mousseJambon, mixer 100 g de jambon, 1 carré frais, 10 cl de Guide, 1 c. à café d\'ail, poivrer. Pour le pesto de tomate, mixer I Potde tomate séchées à l\'huile, 1 c. à café d\'ail, 1 c. à café de pignons de#lüg de parmesan râpé. Laisser reposer 1h au frais. Garnir des petits une couche de tomate, une couche de jambon et terminer par un jambon cru et une feuille de basilic. Ces deux préparations peuvent aussi sersür à agrémenter un plat de pâtes. D\'UTILISATION : Roi de la cuisine méridionale, il s\'associe merveilleusement à la tomate fraîche, aux sauces et s\'utilise aussi dans les vinaigrettes.', 'https://static.openfoodfacts.org/images/products/310/287/004/0463/front_fr.4.400.jpg', '0', '0', '0', '0', '0', '0', '0', '0', '', '1');

